import React from "react";
import ServiceSection from "./services";
import TestimonySection from "./testimony";
import FleetSection from "./fleets";
import ArticlesSection from "./articles";

const LandingContent = ({data}) => {
  return (
    <>
      <ServiceSection title={data.homePage.serviceSectionTitle} subTitle={data.homePage.serviceSectionSubTitle} services={data.services} />
      <TestimonySection title={data.homePage.serviceSectionTitle} subTitle={data.homePage.serviceSectionSubTitle} testimonies={data.testimonies} />
      <FleetSection title={data.homePage.serviceSectionTitle} subTitle={data.homePage.serviceSectionSubTitle} fleets={data.fleets} />
      <ArticlesSection title={data.homePage.serviceSectionTitle} subTitle={data.homePage.serviceSectionSubTitle} articles={data.articles} />
    </>
  );
};

export default LandingContent;
